INSERT INTO `setting` VALUES (1,' 为了保障大家更加稳定畅快的享受游戏，XX服务器将于X月X日（周X）X：XX-X：XX停机进行例行维护，如在此时间内无法完成维护内容，开机时间将顺延，敬请相互转告，并提前做好准备。','抵制不良游戏, 拒绝盗版游戏。 注意自我保护, 谨防受骗上当。 适度游戏益脑, 沉迷游戏伤身。 合理安排时间, 享受健康生活。','充值金币请联系管理员，详情垂询QQ445763687\n欢迎您的垂询！诚招合作代理','1. 七果游戏服务条款的确认\n1.1 七果游戏的所有权与运作权归七果游戏（以下简称\"七果游戏\"或平台）所有。本服务条款具有法律约束力。\n1.2 一旦您点选\"注册\"并通过注册程序，即表示您自愿接受本协议之所有条款，并已成为七果游戏的注册用户。请用户务必在注册之前认真阅读全部服务协议内容，如有任何疑问，可向七果游戏咨询。\n1.4 用户在享用七果游戏网络用户服务的同时，同意接受七果游戏网络用户服务提供的各类信息服务。\n1.3 本服务协议所称的用户是指完全同意本服务协议所有条款（以下简称“服务条款”）并享用七果游戏提供相关服务的接受者。\n \n2. 服务内容\n2.1. 七果游戏会尽可能为用户提供高质量的服务并会根据实际情况对服务做出调整，如用户对调整后的服务有异议，可以选择不继续使用七果游戏服务。\n2.2. 七果游戏在向其用户提供相关网络服务，与相关网络服务有关的设备（如个人电脑、手机、及其他与接入互联网或移动网有关的装置）及所需的费用（如为接入互联网而支付的电话费及上网费、为使用移动网而支付的手机费）均由用户自行负担。\n2.3. 游戏收费服务，除特别提示之外，游戏客户端下载均为免费，游戏运行当中出现连接网络或者下载场景，激活软件，购买道具等操作，有可能被扣费。在出现上述情况之下，七果游戏不完全保证不被扣费。网络游戏是否收费，如何订购，退订，请与游戏运营商客服联系解决。\n3. 用户帐号及密码\n3.1 用户一旦注册成功，便成为七果游戏的注册用户，将得到一个密码和账号。用户有义务保证密码和账号的安全。用户对利用该密码和账号所进行的一切活动负全部责任；因此所衍生的任何损失或损害，快定网络无法也不会承担任何责任。\n3.2 用户的密码和账号遭到未授权的使用或发生其他任何安全问题，用户可以立即通知七果游戏。用户在每次连线结束，应结束账号使用，否则用户可能得不到七果游戏账号的安全保护。\n3.3 七果游戏禁止用户交易七果游戏账号，七果游戏有权收回用户交易的七果游戏账号。如果因用户交易七果游戏账号引起的任何纠纷，七果游戏不承担任何责任。\n4. 用户权责\n4.1. 用户有权按照七果游戏规定的程序和要求使用七果游戏向用户提供的各项网络服务，如果用户对该服务有异议，可以与七果游戏联系以便得到及时解决。\n4.2. 用户在申请使用七果游戏网络服务时，必须向七果游戏提供准确、真实的个人资料，如个人资料有任何变动，必须及时更新。用户保证不以他人资料进行注册或认证。否则因用户提供错误、不完整、不实信息等造成不能通过认证或遭受任何其他损失，由用户自行承担。\n4.3. 用户同意接受七果游戏通过电子邮件或其他方式向用户发送促销或其他相关商业信息。\n4.4. 用户不得利用本站的服务从事以下活动：\n1) 未经允许，进入计算机信息网络或者使用计算机信息网络资源；\n2) 未经允许，对计算机信息网络功能进行删除、修改或者增加；\n3) 未经允许，对进入计算机信息网络中存储、处理或者传输的数据和应用程序进行删除、修改或者增加；\n4) 故意制作、传播计算机病毒等破坏性程序；\n5) 其他危害计算机信息网络安全的行为。\n4.5. 用户不得以任何方式干扰本站的服务。\n4.6. 用户承诺遵守本站的所有其他规定和程序。\n5. 言论规范\n5.1. 用户在七果游戏的网页上发布信息或者利用七果游戏的服务时必须符合国家的法律法规以及国际法的有关规定。\n5.2. 对于用户通过七果游戏网上消息平台（包括但不限于论坛、BBS、评论）上传到七果游戏网站上可公开获取区域的任何内容，用户同意授予七果游戏在全世界范围内享有完全的、免费的、永久性的、不可撤销的、非独家的权利，以及再许可第三方的权利，以使用、复制、修改、改编、出版、翻译、据以创作衍生作品、传播、表演和展示此等内容（整体或部分），和/或将此等内容编入当前已知的或以后开发的其他任何形式的作品、媒体或技术中。\n5.3. 用户承诺不会在七果游戏的消息平台（包括但不限于论坛、BBS、评论）发布如下信息：\n1) 反对宪法所确定的基本原则的；\n2) 危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；\n3) 损害国家荣誉和利益的；\n4) 煽动民族仇恨、民族歧视，破坏民族团结的；\n5) 破坏国家宗教政策，宣扬邪教和封建迷信的；\n6) 散布谣言，扰乱社会秩序，破坏社会稳定的；\n7) 散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的；\n8) 侮辱或者诽谤他人，侵害他人合法权益的；\n9) 含有法律、行政法规禁止的其他内容的。\n5.4. 用户单独为其发布在七果游戏上信息承担责任。用户若在七果游戏散布和传播违法信息，网络用户服务的系统记录有可能作为用户违法之证据。\n5.5. 如果用户违反上述规定，七果游戏有权要求其改正或直接采取一切必要措施（包括但不限于更改或删除用户发布的信息、中断或终止用户使用网络的权利等），以减轻用户不当行为所造成的影响。\n6. 服务条款的修改\n七果游戏保留依其自主判断在将来的任何时间变更、修改、增加或删除本服务协议条款的权利。所有修改的协议均构成本服务协议的一部分。七果游戏有权随时对服务条款进行修改，一旦发生服务条款的变动，七果游戏将公示修改的内容；当用户使用七果游戏账号的任何服务时，应接受七果游戏账号随时提供的与该服务相关的规则或说明，并且此规则或说明均构成本服务条款的一部分。用户如果不同意服务条款的修改，可以主动取消已经获得的服务；如果用户继续享用七果游戏服务，则视为用户已经接受服务条款的修改。\n用户隐私保护\n7.1. 七果游戏尊重用户的隐私权，不会公开、编辑或泄露任何有关用户的个人资料以及用户在使用网络服务时存储在七果游戏的非公开内容，但以下情况除外：\n1) 事先获得用户的明确授权；\n2) 遵守法律规定或七果游戏合法服务程序；\n3) 按照相关政府主管部门的合理要求；\n4) 维护社会公众利益；\n5) 维护七果游戏的合法权益；\n6) 符合其他合法要求。\n7.2. 平台可能会与第三方合作向用户提供相关的网络服务，在此情况下，如该第三方同意承担与平台同等的保护用户隐私的责任，则平台有权将用户的注册资料等提供给该第三方。\n7.3. 在不透露单个用户隐私资料的前提下，平台有权对整个用户数据库进行分析并对用户数据库进行商业上的利用。\n7.4. 七果游戏以以下隐私权保护原则，指导我们如何来处理产品中涉及到互联网用户隐私权和互联网用户信息等方面的问题:\n1) 利用我们收集的信息为互联网用户提供有价值的产品和服务。\n2) 尽最大的努力保护我们掌握的信息。\n7.5. 发生下列情况时七果游戏无需承担任何责任：\n1) 战争、事变、天灾地变等，不可抗力等情况。\n2) 使用者故意或过失所造成损害。\n3) 因通信服务提供业者方面造成之通信障碍。\n4) 由于用户将用户密码告知他人或与他人共享注册账户，由此导致的任何个人资料泄露。\n5) 任何由于黑客攻击、计算机病毒侵入或发作、因政府管制而造成的暂时性关闭等影响网络正常经营之不可抗力而造成的个人资料泄露、丢失、被盗用或被窜改等。\n6) 由于与七果游戏链接的其它网站所造成之个人资料泄露及由此而导致的任何法律争议和后果。\n7) 其他非七果游戏所能控制或掌握之事项。\n8. 服务的中断或终止\n8.1. 鉴于网络的不稳定性和特殊性，七果游戏在尽可能保证高质量服务的前提下保留随时中断其部分或全部网络服务的权利；除非遇到特殊情况（如停电，服务器故障等）七果游戏会提前通知用户关于可能遇到的服务中断情况，但并不为此对用户及任何第三方可能造成的不便或损失负责。\n8.2. 七果游戏有权在未事前通知的情况下在任何时候，暂时或永久地修改或终止本服务或其中任何一部分。七果游戏对本服务的修改或终止对用户和任何第三人不承担任何责任。\n8.3. 如发生下列任何一种情形，七果游戏有权随时中断或终止向用户提供本协议项下的网络服务，而无需对用户或任何第三方承担任何责任。\n1) 用户向七果游戏提供的个人资料不真实。\n2) 用户违反本协议的规则或不履行其所承担的义务。\n除此之外，用户可随时根据需要通知七果游戏终止向该用户提供服务，用户服务终止后，用户使用服务的权利同时终止。自用户服务终止之时起，七果游戏不再对该用户承担任何责任。\n9. 知识产权\n9.1. 七果游戏在网络服务中提供的任何文本、图片、图形、音频和视频资料均受版权、商标权以及其他相关法律法规的保护。未经七果游戏事先同意，任何人不能擅自复制、传播这些内容，或用于其他任何商业目的，所有这些资料或资料的任何部分仅可作为个人或非商业用途而保存在某台计算机内。\n9.2. 七果游戏为提供网络服务而使用的任何软件（包括但不限于软件中的任何文字、图形、音频、视频资料及其辅助资料）的一切权利属于该软件的著作权人，未经该著作权人同意，任何人不得对该软件进行反向工程、反向编译或反汇编。\n9.3. 如有著作权人发现用户在七果游戏发表的内容侵犯其著作权，并依《互联网著作权行政保护办法》、《信息网络传播保护条例》的规定向七果游戏发出书面通知并提供相关内容的著作权权属证明的，七果游戏有权在不事先通知用户的情况下自行移除相关内容，并依法保留相关数据。\n9.4. 若用户对9.3条指向内容依法享有发表权，可以向七果游戏及9.3条指向之著作权人一并发出说明被移除内容不侵犯其著作权的反通知，反通知应为书面形式，并包含如下内容：\n1) 明确的身份证明、住址、联系方式；\n2) 被移除内容的合法性证明；\n3) 被移除内容在互联网上的位置；\n4) 反通知内容的真实性声明。\n符合规定的反通知发出后，七果游戏有权恢复被移除内容。\n10. 未成年人上网安全指引\n10.1. 七果游戏不向未成年人提供服务。\n10.2. 在七果游戏进行付费充值服务的，应在监护人指导和监督下使用。\n10.3. 七果游戏网友要注意区分网络与现实的区别，避免沉迷于网络。\n10.4. 如有违法行为，七果游戏保留配合公安和电信部门追查的权利。七果游戏郑重提醒用户正确认识网络世界，重视参加网络活动的安全性，加强防范，确保安全。\n11. 免责声明\n11.1. 平台服务因涉及多方协作，如互联网运营商，移动通讯服务及通讯工具、服务器等,用户需承担如感染病毒、通信线路不稳定、系统不稳定、GSM网络不稳、会员操作失误、使用第三方工具、恶意破解、黑客攻击等不可抗及不可预知因素带来的问题。用户可以选择是否开通平台服务，一旦开通服务用户需承担以上风险，平台对包括但不限于以上因素所产生问题，不做稳定性保证，亦不承担任何责任。\n11.2. 七果游戏对任何因用户不正当或非法使用服务、在网上进行交易、或用户传送信息变动而产生的直接、间接、偶然、特殊及后续的损害不承担责任。\n11.3. 七果游戏对任何他人的威胁性的、诽谤性的、淫秽的、令人反感的或非法的内容或行为或对他人权利的侵犯（包括知识产权）不承担责任；并对任何第三方通过服务发送或在服务中包含的任何内容不承担责任。\n11.4. 用户明确同意其使用七果游戏服务所存在的风险以及使用七果游戏网络服务产生的一切后果由其自己承担。\n11.5. 平台服务如有任何异常情况，七果游戏承诺第一时间进行修复工作。所有修复工作，用户需全力配合，用户因平台异常产生的损失，七果游戏不承担任何责任。\n11.6. 平台提供的链接如涉及到国际互联网资源，用户可以决定是否使用，平台不保证这些网站对用户的可用性及链接网站信息的真实性。若用户使用本站外的其他网站，造成了损失或者问题，用户可以举报此网站，七果游戏会及时作出取消链接等处理，但七果游戏不承担直接或间接责任。\n11.7. 由于与七果游戏链接或合作的其它网站（如网上银行等）所造成的银行账户信息、身份信息泄露及由此而导致的任何法律争议和后果。\n11.8. 任何用户（包括未成年人用户）向平台提供错误、不完整、不实信息等造成不能通过认证或遭受任何其他损失，概与七果游戏无关。\n12. 赔偿\n因用户对本服务之使用而导致七果游戏遭受任何来自第三方之纠纷、诉讼及索赔要求，用户同意向七果游戏及其关联企业、职员赔偿相应损失（包括合理的律师费），并尽力使之免受损害。\n13. 通告\n七果游戏向用户发出的通知，可以采用电子邮件、页面公告、常规信件、电话或七果游戏认为适合的形式。服务条款的修改或其他事项变更时，七果游戏将会以上述形式进行通知。\n14. 法律的适用和管辖\n本服务条款的生效、履行、解释及争议的解决均适用中华人民共和国法律，发生的争议提交杭州仲裁委员会裁决。如果本服务协议中某项条款因与中华人民共和国现行法律相抵触而导致无效，将不影响其他部分的效力。\n15. 其他规定\n本协议中的标题仅为方便而设，在解释本协议时应被忽略。\n16. 全部协议\n本服务协议和七果游戏的其他服务条款构成完整的协议。\n17. 生效条件\n本协议自用户访问、浏览及使用七果游戏之时开始生效。',100);

#
# Structure for table "user"
#

DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(32) NOT NULL COMMENT '昵称',
  `open_id` varchar(128) NOT NULL,
  `uuid` varchar(64) NOT NULL COMMENT '用户唯一uuid',
  `avatar` varchar(256) DEFAULT NULL COMMENT '用户头像地址',
  `sex` int(11) NOT NULL COMMENT '0:女生,1:男生,2:未知',
  `create_date` datetime NOT NULL,
  `update_date` datetime NOT NULL,
  `version` int(11) NOT NULL DEFAULT '0',
  `gold` int(11) NOT NULL DEFAULT '0',
  `history_gold` int(11) NOT NULL DEFAULT '0',
  `level` int(11) NOT NULL DEFAULT '0' COMMENT '用户代理级别',
  `mobile` varchar(16) DEFAULT NULL,
  `login_token` varchar(64) DEFAULT NULL,
  `ip` varchar(32) DEFAULT '0' COMMENT 'ip',
  `longitude` double NOT NULL DEFAULT '0' COMMENT 'ip',
  `latitude` double NOT NULL DEFAULT '0' COMMENT 'ip',
  `password` varchar(128) NOT NULL COMMENT '密码',
  PRIMARY KEY (`id`),
  UNIQUE KEY `open_id` (`open_id`),
  UNIQUE KEY `uuid` (`uuid`),
  UNIQUE KEY `mobile` (`mobile`)
) ENGINE=InnoDB AUTO_INCREMENT=100017 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='用户';

