#
# Structure for table "user_agent_token"
#

DROP TABLE IF EXISTS `user_agent_token`;
CREATE TABLE `user_agent_token` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `token` varchar(64) DEFAULT NULL COMMENT '登录token',
  `create_time` bigint(20) DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `token` (`token`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='用户代理平台登录token';

