#
# Structure for table "user_link_room"
#

DROP TABLE IF EXISTS `user_link_room`;
CREATE TABLE `user_link_room` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '牌局id',
  `user_id` int(11) NOT NULL COMMENT '用户id',
  `room_id` int(11) NOT NULL COMMENT '房间id',
  `room_check_id` varchar(10) DEFAULT NULL COMMENT '房间的check-id,进入id,可以重复,但是不允许同时活跃状态的id 相同',
  `user0` int(11) NOT NULL COMMENT '用户0',
  `user1` int(11) NOT NULL COMMENT '用户1',
  `user2` int(11) NOT NULL COMMENT '用户2',
  `user3` int(11) NOT NULL COMMENT '用户3',
  `userName0` varchar(32) DEFAULT NULL COMMENT '用户0',
  `userName1` varchar(32) DEFAULT NULL COMMENT '用户1',
  `userName2` varchar(32) DEFAULT NULL COMMENT '用户2',
  `userName3` varchar(32) DEFAULT NULL COMMENT '用户3',
  `score0` int(11) NOT NULL COMMENT '积分0',
  `score1` int(11) NOT NULL COMMENT '积分1',
  `score2` int(11) NOT NULL COMMENT '积分2',
  `score3` int(11) NOT NULL COMMENT '积分3',
  `start_date` datetime NOT NULL,
  `end_date` datetime DEFAULT NULL,
  `chapter_nums` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='游戏房间';

